import { InputLabel, MenuItem, Select, TextField } from '@mui/material';
import React from 'react';
import { useDispatch } from 'react-redux';
import { nameAction, dobAction } from '../../redux/acitons/studentActions';
export default function StudentForm() {
  const dispatch = useDispatch();

  const handleName = (e) => {
    dispatch(nameAction());
  };

  const handleDateOfBirth = (e) => {};

  return (
    <div>
      <InputLabel id="demo-simple-select-label">Students Name</InputLabel>
      <TextField
        onChange={(e) => handleName(e)}
        type="text"
        id="standard-basic"
        variant="standard"
      />
      <InputLabel id="demo-simple-select-label">D.O.B</InputLabel>
      <TextField type="text" id="standart-basic" label="dd/mm/yy" />
      <InputLabel id="demo-simple-select-label">Student Class</InputLabel>
      <Select
        labelId="demo-simple-select-label"
        id="demo-simple-select"
        label="Student Class">
        <MenuItem value={'it'}>IT</MenuItem>
        <MenuItem value={'math'}>Math</MenuItem>
        <MenuItem value={'literature'}>Literature</MenuItem>
      </Select>
    </div>
  );
}
